ed_eyes::kiss::pray:I’m smirking:smirk::smirk::smirk::smirk::smirk::triumph::face_with_rolling_eyes: right now just imagining :thinking_face::expressionless::face_with_rolling_eyes:🤣one of those addlepated simpletons :neutral_face::hushed::expressionless::x:scratching their heads in confusion :question::unamused::thinking_face::sob::sweat::question:as Dan Harmon’s :weary::eggplant::sweat_drops::peach::triumph::ok_hand::point_right::ok_hand:genius :relaxed::stuck_out_tongue_closed_eyes::nerd_face::stuck_out_tongue_winking_eye::100:unfolds itself on their television screens. :raised_hands::laughing::kissing_heart::heart_eyes:What fools... how I pity them. :triumph::expressionless::joy::-1: And yes :+1::clap::raised_hands::kissing_cat::heart_eyes_cat::sweat_drops::heart:by the way, I DO have a Rick and Morty:older_man: :man-kiss-man::boy::triumph::tired_face::sweat_drops:tattoo. :heart::clap::raised_hands::+1::ok_hand::100:And no,:confounded::expressionless::confused: you cannot see it. :no_entry_sign::facepunch::x::scream_cat::no_good:‍♂️‼️:100:It’s for the ladies’ :triumph::kissing_heart::eggplant::sweat_drops::peach::information_desk_person::umbrella_with_rain_drops::weary:eyes only:eyes::kiss::tongue::sweat_drops::+1::heart::100:- And even they :stuck_out_tongue_winking_eye::yum::smirk::kissing_cat::heart_eyes_cat:have to demonstrate :point_up::clap::raised_hands::100:that they’re within 5 IQ points:100::+1::heart::ok_hand::kissing_heart::heart_eyes: of my own (preferably lower) :relieved::triumph::sunglasses::nerd_face:beforehand.:peach::peach::peach::umbrella_with_rain_drops::100::smirk::eggplant::sweat_drops::100::heart_eyes_cat::kissing_heart::heart_eyes::grin::heart::100::triumph::weary::tired_face::clap::raised_hands::+1::point_right::ok_hand::facepunch:','U5TQU3WQ7','2017-12-13 14:46:29');
