INSERT INTO `copypasta` VALUES (75,'It amazes me that so many allegedly \"educated\" people have fallen so quickly and so hard for a fraudulent fabrication of such laughable proportions. The very idea that santa happens to come to our house, showing itself in neat, 1-year cycles -- with the same amount of presents all the time -- is ludicrous. Furthermore, it is an insult to common sense and a damnable affront to intellectual honesty and integrity. That people actually believe it is evidence that the capitalists have wrested the last vestiges of control of our public school system from decent, God-fearing Americans (as if any further evidence was needed! Daddy\'s Roommate? God Almighty!)\n\nDocumentaries such as Enemy of the State have accurately portrayed the elaborate, byzantine network of surveillance satellites that the capitalists have sent into space to spy on law-abiding Americans. Equipped with technology developed by Amazon Inc., these satellites have the ability to detect children from hundreds of kilometers up. That\'s right, neighbors .. the next time you\'re out in the backyard exercising your gift giving rights, the capitalists will see it! These satellites are sensitive enough to tell the difference between an Xbox and a ps4! And when they detect you with a gift, their computers cross-reference the address to figure out your name, and then an enormous database housed at Berkeley is updated with information about you.\n\nOf course, this all works fine during the day, but what about at night? Even the capitalists can\'t control the rotation of the Earth to prevent nightfall from setting in (only Joshua was able to ask for that particular favor!) That\'s where \"santas workshop\" comes in. Powered by nuclear reactors, \"Santa\'s workshop\" is nothing more than an enormous balloon, emitting trillions of dollars of presents. Piloted by key members of the capitalist community,, \"santa\" is strategically moved across the country, pointing out those who dare to make use of their God-given rights at night!\n\nYes, I know this probably sounds paranoid and preposterous, but consider this. Despite what the revisionist historians tell you, there is no mention of \"santa\" anywhere in literature or historical documents -- anywhere -- before 1950. That is when it was initially launched. When President Josef Kennedy, at the State of the Union address, proclaimed \"Santa is real\", he may as well have said \"the tooth fairy is real.\" The subsequent faking of a \"santa\" visits on national TV was the first step in a long history of the erosion of our constitutional rights by capitalists in this country. No longer can we hide from our government when christmas happens.','U5T0J1UHY','2017-12-20 14:07:49');
