::school:. I\'m so fucking irate :rage:🤬:triumph:. I have been a member :ticket::grin: of this community :busts_in_silhouette::busts_in_silhouette::video_game:🥊:boom: FOR YEARS :calendar::date: and just now :clock3::grey_question: I\'m a nuisance :confused::baby:? I am entitled :blush::100: to a certain level :level_slider::up: of RESPECT :bow::bow:‍♀️:ok_hand::+1: for being a veteran player :date::triumph::video_game:. I\'m looking 🤨:eyes: into finding a lawyer 🤵:scales: who\'ll get me unbanned :runner::school::+1::grin::video_game:. There MUST be a law :memo::page_with_curl: that prevents :negative_squared_cross_mark::no_good:‍♀️ people :boy::girl: from arbitrarily :thinking_face::no_entry_sign: banning others :triumph::hand::no_entry_sign::cry: from certain locations :earth_africa::earth_asia::round_pushpin: without written documents :memo::x:🤷 proving it :memo::white_check_mark::heavy_check_mark: (the TO just SAID :wink::speech_balloon: I was banned 🥊:boom::crossed_swords::no_entry_sign::sob: he did not 🤷‍♂️:no_good:‍♂️:no_entry_sign: provide any evidence :page_with_curl::newspaper::question:.) The TO :money_mouth_face::+1: isn\'t rich :pensive::-1::dollar::x: or anything so I don\'t think :thinking_face::thought_balloon::no_entry_sign: I would have to ask :speaking_head_in_silhouette: a lot of him :grinning::boy:, I\'d think he\'d just break :bow::disappointed_relieved: under pressure of lawsuit 🤵:man:‍:scales::memo::scales::sweat:.','U5SV39UP5','2017-12-26 16:38:01');
